import React from "react";

import { Container } from "reactstrap";

import Desk from "./containers/Desk/Desk";
import "./App.css";

const App = (props) => {
  return (
    <Container
      style={{
        backgroundImage: `url("hhttps://www.google.com/search?q=img&rlz=1C5CHFA_enUS843US843&sxsrf=ALeKk01jAHdHrvvLph2ZTKuzuNJT2e1_5Q:1591757715707&source=lnms&tbm=isch&sa=X&ved=2ahUKEwjE8dnJn_bpAhVjGjQIHRB4CWsQ_AUoAnoECA4QBA&biw=1920&bih=952#imgrc=5530Y_OS84MS7M")`,
        backgroundRepeat: "no-repeat",
        width: "250px",
        height: "250px",
      }}
      fluid="true"
      className="App"
    >
      <Desk />
    </Container>
  );
};

export default App;
